DROP TABLE IF EXISTS `fa_more`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `fa_more` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(160) CHARACTER SET utf8 NOT NULL COMMENT '标题',
  `content` text NOT NULL COMMENT '内容',
  `keywords` varchar(1200) CHARACTER SET utf8 NOT NULL COMMENT '关键字',
  `description` varchar(3000) CHARACTER SET utf8 NOT NULL COMMENT '描述',
  `image` varchar(60) CHARACTER SET utf8 NOT NULL COMMENT '缩略图',
  `company` varchar(60) DEFAULT NULL COMMENT '公司',
  `price` char(20) DEFAULT NULL COMMENT '价格',
  `download` int(11) NOT NULL DEFAULT '0' COMMENT '下载次数',
  `pv` int(11) NOT NULL DEFAULT '0' COMMENT '浏览量',
  `createtime` int(11) NOT NULL COMMENT '创建时间',
  `updatetime` int(11) NOT NULL COMMENT '更新时间',
  `status` enum('hidden','normal') CHARACTER SET utf8 NOT NULL DEFAULT 'hidden' COMMENT '状态:hidden=隐藏,normal=显示',
  `collect` int(11) DEFAULT '0' COMMENT '收藏',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=697 DEFAULT CHARSET=utf8mb4 COMMENT='更多表';
/*!40101 SET character_set_client = @saved_cs_client */;

