: 20px;\">5.物资管理：物资库管理、仓库管理、物资计划（甲供/自购）、物资申购、出库/入库管理、库存管理。</span></p><p><span style=\"font-size: 20px;\">6.档案管理和流程管理。</span></p><p><span style=\"font-size: 20px;\">7.报表管理：项目报表、合同报表、预算报表、物资报表。</span></p><p><span style=\"font-size: 20px;\">8.个人中心：已办/待办任务、信息中心、我的流程等等。</span></p><p><br></p><p><span style=\"font-size: 20px;\">二、强大的工程项目管理系统，支持所有建筑、工程行业公司使用，支持流程自定义，动态追加流程节点，动态追加流程审批人员。</span><span style=\"color: rgb(36, 41, 46); font-size: 20px;\">这个是一家大型的房地产公司用的，主要是管合同，成本，预算，里面可以多公司管理和集团化管理。</span></p><p><br></p><p><span style=\"font-size: 20px;\">三、场景定位：施工企业工程项目管理</span><img src=\"/uploads/20241110/h4wy4mw3njq.jpg\"><img src=\"/uploads/20241110/4clwj45ngiw.jpg\"><img src=\"/uploads/20241110/zqo4eoszuo2.jpg\"><img src=\"/uploads/20241110/eibdfyhqfjd.jpg\"><img src=\"/uploads/20241110/y1z2vegbnjc.jpg\"><img src=\"/uploads/20241110/1tfa4z5glzf.jpg\"><img src=\"/uploads/20241110/snmnocr3nn4.jpg\"></p>','云南遥遥科技有限公司项目管理系统（集团版）,项目管理系统（集团版）','云南遥遥科技有限公司项目管理系统（集团版）,这个是一家大型的房地产公司用的，主要是管合同，成本，预算，里面可以多公司管理和集团化管理','/uploads/20241110/exd5d0l0bfh.jpg','云南遥遥科技有限公司','',451,0,1731216843,1731216843,'hidden',71),(14,'项目管理系统（现场版）','<p class=\"ql-align-justify\"><span style=\"color: rgb(36, 41, 46); font-size: 20px;\">一、此系统主要是施工现场，质量，安全，进度等管理。</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(36, 41, 46); font-size: 20px;\">主要是以项目为单位，右上角可以切换项目。</span></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><span style=\"font-size: 20px;\">二、项目管理系统的优势主要体现在优化项目管理流程，提高项目管理效率。</span></p><p><span style=\"color: rgb(26, 26, 26); font-size: 20px;\">1.项目计划与执行不脱节</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(26, 26, 26); font-size: 20px;\">项目计划与执行同步，动态反映项目最新的进展，并支持保存多个项目基线以作对比。</span></p><p><span style=\"color: rgb(26, 26, 26); font-size: 20px;\">2.一个页面了解动态项目全局</span></p><p><span style=\"color: rgb(26, 26, 26); font-size: 20px;\">业务地图让您一个页面即能掌控整个项目的实况，第一时间洞悉项目风险与问题。</span></p><p><span style=\"color: rgb(26, 26, 26); font-size: 20px;\">3.进度逾期，预算超支自动预警</s