6909,1731216909,'hidden',31),(34,'外卖小程序','<p><br></p><p><img src=\"/uploads/20241110/ujpwiqipawd.jpg\" alt=\"内容图片\"></p><p><img src=\"/uploads/20241110/5akcuuyjgqu.jpg\" alt=\"内容图片\"></p><p><img src=\"/uploads/20241110/221r2gjurmm.jpg\" alt=\"内容图片\"></p><p><img src=\"/uploads/20241110/qqslznmb44k.jpg\" alt=\"内容图片\"></p>','七牛(成都)智能科技有限公司外卖小程序,外卖小程序','七牛(成都)智能科技有限公司外卖小程序,各外卖平台大额无门槛优惠券红包小程序每天可领取，快速送餐。APP开发需要根据具体功能要求定制价格，详情请咨询商家。','/uploads/20241110/efxoun5qcbc.jpg','七牛(成都)智能科技有限公司','',91,0,1731216911,1731216911,'hidden',19),(35,'智能仓储管理','<p>	仓储管理在物流管理中占据着核心的地位。传统的仓储业是以收保管费为商业模式的，希望自己的仓库总是满满的，这种模式与物流的宗旨背道而驰。现代物流以整合流程、协调上下游为己任，静态库存越少越好，其商业模式也建立在物流总成本的考核之上。由于这两类仓储管理在商业模式上有着本质区别，但是在具体操作上如入库、出库、分拣、理货等又很难区别，所以在分析研究必须注意它们的异同之处，这些异同也会体现在信息系统的结构上。 随着制造环境的改变，产品周期越来越短，多样少量的生产方式，对库存限制的要求越来越高，因而必须建立及执行供应链管理系统，借助电脑化、信息化将供应商、制造商、客户三者紧密联合，共担库存风险。仓储管理可以简单概括为8个关键管理模式:追-收-查-储-拣-发-盘-退。</p><p>	库存的最优控制部分是确定仓库的商业模式的，即要(根据上一层设计的要求)确定本仓库的管理目标和管理模式，如果是供应链上的一个执行环节，是成本中心，多以服务质量、运营成本为控制目标，追求合理库存甚至零库存。因此精确了解仓库的物品信息对系统来说至关重要，所以我们提出要解决精确的仓储管理。</p><p>	仓储管理及精确定位在企业的整个管理中起着非常重要的作用，如果不能保证及时准确的进货、库存控制和发货，将会给企业带来巨大损失，这不仅表现为企业各项管理费用的增加，而且会导致客户服务质量难以得到保证，最终影响企业的市场竞争力。所以我们提出了全新基于射频识别的仓库系统方案来解决精确仓储管理问题。注意和SNHGES系统不同 。下面我们来分析采用射频识别技术后给企业带来的经济效益。</p>','西安易创同辉智能科技有限公司智能仓储管理,智能仓储管理','西安易创同辉智能科技有限公司智能仓储管理, 智能仓储管理系统(MT-WMS)结合自动识别技术(RFID/Barcode)，对收货、质检、入库、出库、盘点、调拨、转仓、寄售等仓储环节进行智能化管理，实现关键件/批次物料的追踪、入出库、货物流转、库存盘点、仓储配送的细化管理与控制，有利于加快货物周转效率，减少呆料积压、提升仓储作业效率、减轻人工劳动强度、降低仓储管理成本。','/uploads/20241110/2irkdamlffm.jpg','西安易创同辉智能科技有限公司','',678,0,1731216913,1731216913,'hidden',5),(36,'飞机牵引车智能导航系统','<p>通过梳理牵引飞机停放的业务流程，分析结果表示在传统的业务流程中，每个工序实际上都需要大量的人工干预，所有人工干预的内容包括了实施前的组织、培训；实施中的协同、配合；实施后检查，复核。同时，人为因素成为了工序中对安全影响的不确定因素。针对民航对安全的“零容忍”原则，结合人工智能、物联网打造的“飞机牵引车智能导航系统”可以大幅消减工序中的重复工作，并且利用机器系统的“铁面无私”做到“大错预警，小错不漏”及时为监督、执行岗位的工作人员提供流程信息，工序执行信息，成为决策者实时的眼观六路，耳听八方好助手。</p><p>根据循序渐进，逐步完善的原则，我们提出部署人机结合的系统，便于业务流程顺利实施。</p><p><br></p>','西安易创同辉智能科技有限公司飞机牵引车智能导航系统,飞机牵引车智能导航系统','西安易创同辉智能科技有限公司飞机牵引车智能导航系统,为了提高飞机地面自动牵引滑行导航控制系统的精度,提出一种改进的纯追踪算法。基于纯追踪算法对飞机牵引车系统的路径进行跟踪控制,将简化的两轮模型作为其运动学模型。融合经典纯追踪算法及改进算法确定新的预测目标点,以减少轨迹误差。采用偏差统计的方法实现不同预测距离下最优融合系数的选择,提高控制精度。仿真结果表明,该算法的路径轨迹误差控制在0.5 m范围内,满足飞机自动牵引滑行的精度要求,验证了其可行性和有效性','/uploads/20241110/qsofiw4evu0.jpg','西安易创同辉智能科技有限公司','',117,0,1731216914,1731216914,'hidden',69),(37,'智慧农业','<p><span style=\"color: rgb(49, 49, 49);\">&nbsp;智慧农业是农业生产的高级阶段，是集新兴的互联网、移动互联网、云计算和物联网技术为一体，依托部署在农业生产现场的各种传感节点（环境温湿度、土壤水分、二氧化碳、图像等）和无线通信网络实现农业生产环境的智能感知、智能预警、智能决策、智能分析、专家在线指导，为农业生产提供精准化种植、可视化管理、智能化决策。</span></p><p><br></p><p><span style=\"color: rgb(49, 49, 49);\">智慧农业”是云计算、传感网、3S等多种信息技术在农业中综合、全面的应用，实现更完备的信息化基础支撑、更透彻的农业信息感知、更集中的数据资源、更广泛的互联互通、更深入的智能控制、更贴心的公众服务。</span></p><p><span style=\"color: rgb(49, 49, 49);\">利用温度、湿度、光照、二氧化碳气体等多种传感器对农牧产品（蔬菜、禽肉等）的生长过程进行全程监控和数据化管理，通过传感器和土壤成份检测感知生产过程中是否添加有机化学合成的肥料、农药、生长调节剂和饲料添加剂等物质；结合RFID电子标签对每批种苗来源、等级、培育场地以及在培育、生产、质检、运输等过程中具体实施人员等信息进行有效、可识别的实时数据存储和管理。系统以物联网平台技术为载体，提升有机农产品的质量及安全标准，从而让老百姓能够吃上放心菜。</span></p><p><span style=\"color: rgb(49, 49, 49);\">农产品质量管理系统，通过固定式专用RFID阅读器自动识别个体，进行自动分拣归栏，自动饲喂、自动追踪记录活动规律、饲养数据等，监控农产品（生猪）生长密度、环境参数，通过网络实时更新到档案数据库。进而通过RFID或条形码管理系统实现物流的追溯（通过包装条码查询产品物流状态）和产品质量的追溯（查询此批次产品的相关质量数据），为客户提供产品增值服务，同时也为企业生产管理者提供一手的现场数据。</span></p><p><span style=\"color: rgb(49, 49, 49);\"><span class=\"ql-cursor\">﻿</span>&nbsp;农业专家远程诊断服务系统，采用3G无线传输技术、H.264网络视频压缩技术术将视频信息、控制信息等监控数据进行压缩编码，通过无线数据网络，传给专家，实现专家足不出户，即可远程实时指导、浏览和在线答疑、咨询等服务。并可记录视频信息的一整套远程专家诊断系统产品。</span></p><p><br></p>','西安易创同辉智能科技有限公司智慧农业,智慧农业','西安易创同辉智能科技有限公司智慧农业,&ldquo;智慧农业&rdquo;是由数字农业、智能农业等名词演化而来，其技术体系主要包括农业物联网、农业大数据和农业云平台等三个方面。充分应用现代信息技术成果，集成应用计算机与网络技术、物联网技术、音视频技术、传感器技术、无线通信技术及专家智慧与知识平台，实现农业可视化远程诊断、远程控制、灾变预警等智能管理、远程诊断交流、远程咨询、远程会诊，逐步建立农业信息服务的可视化传播与应用模式；实现对农业生产环境的远程精准监测和控制，提高设施农业建设管理水平，依靠存储在知识库中的农业专家的知识，运用推理、分析等机制，指导农牧业进行生产和','/uploads/20241110/53pkntmiazq.jpg','西安易创同辉智能科技有限公司','',549,0,1731216914,1731216914,'hidden',29),(38,'工业企业物联网的应用','<p>	生产管理系统开发是针对制造型企业的生产运营与生产管理而服务的。生产管理系统主要包括订单管理、生产计划管理、成本管理、物料需求计划、采购管理、库存管理、付款管理、质量管理、生产绩效等核心管理系统，进行生产管理系统建设能够提高各组织部分管理的准确性和及时性，准确地指导原材料定购，及时掌控各方数据信息，优化资金的合理使用，节省生产成本的同时提高生产的效率。</p><p>	数字视频、音频监控生产流程及其相关信息的生产管理系统，以其直观，易于存储、检索和共享的特点，成为实现企业生产可视化生产信息管理的重要手段。企业可视化生产管理系统是一个运用互联网、计算机科技，对传统视频监控系统在新体系结构和应用功能上进行延伸和扩展，来实现对企业生产安全和生产管理可视化监管控制的管理系统，它是在管理手段与监控手段，以及通讯手段上的进步与更新升级，实施生产管理系统解决方案是未来生产管理的必然趋势，是实现企业现代化管理的信息手段的一部分。</p><p><br></p>','西安易创同辉智能科技有限公司工业企业物联网的应用,工业企业物联网的应用','西安易创同辉智能科技有限公司工业企业物联网的应用,主要应用于信息化程度低的中小制造业企业:数据可直接由车间设备\n及传感设备采集，直通信息化系统,覆盖核心需求，是深入行业的&ldquo;研发项目管理+经营管理+生产管理&rdquo;的专业系统','/uploads/20241110/toyy2nr1jnz.jpg','西安易创同辉智能科技有限公司','',397,0,1731216916,1731216916,'hidden',37),(39,'服务器安全运维 DDOS CC 扛把子','<p><strong style=\"font-size: 36px;\">服务器安全运维</strong></p>','福建小池塘边网络科技有限公司服务器安全运维 DDOS CC 扛把子,服务器安全运维 DDOS CC 扛把子','福建小池塘边网络科技有限公司服务器安全运维 DDOS CC 扛把子,服务器安全运维，服务器安全策略部署，攻击防御。','/uploads/20241110/13vk4ih2ppz.jpg','福建小池塘边网络科技有限公司','1000',339,0,1731216917,1731216917,'hidden',97),(40,'定制开发','<p><img src=\"/uploads/20241110/njerrjiklzr.jpg\" alt=\"内容图片\"></p><p><img src=\"/uploads/20241110/5chj00lx00h.jpg\" alt=\"内容图片\"></p><p><img src=\"/uploads/20241110/4fmsg5zpuf1.jpg\" alt=\"内容图片\"></p>','保定硕果网络科技有限公司定制开发,定制开发','保定硕果网络科技有限公司定制开发,小程序定制开发','/uploads/20241110/lkeqrdi3t34.jpg','保定硕果网络科技有限公司','',504,0,1731216919,1731216919,'hidden',75),(41,'01 ThinkPHP|TP框架多用户商城系统|含PC和手机端','<p class=\"ql-align-center\"><img src=\"/uploads/20241110/medijippd54.jpg\" alt=\"内容图片\"></p><p><br></p><p><img src=\"/uploads/20241110/jvdk5tvdmk5.jpg\" alt=\"内容图片\"></p>','成都程志科技有限公司01 ThinkPHP|TP框架多用户商城系统|含PC和手机端,01 ThinkPHP|TP框架多用户商城系统|含PC和手机端','成都程志科技有限公司01 ThinkPHP|TP框架多用户商城系统|含PC和手机端,每个商家拥有自己的店铺，可以店铺选择不同的主题风格，平台可在首页或活动频道推广相应的商品，实现各个类别都可发布商品','/uploads/20241110/tsmlt4n0ub1.jpg','成都程志科技有限公司','',501,0,1731216922,1731216922,'hidden',82),(42,'02 人才招聘在线系统|企业发布招聘信息|个人求职','<p class=\"ql-align-center\"><img src=\"/uploads/20241110/wdn2042f5mp.jpg\" alt=\"内容图片\"></p>','成都程志科技有限公司02 人才招聘在线系统|企业发布招聘信息|个人求职,02 人才招聘在线系统|企业发布招聘信息|个人求职','成都程志科技有限公司02 人才招聘在线系统|企业发布招聘信息|个人求职,需求背景\n1.交流平台：人才招聘在线系统，为企业和求职者提供在线交流平台。\n2.企业：企业可在线发布招聘职位，查看应聘简历库，查询所有人才库信息，查看职位统计，自助延期或提升企业级别，管理公司信息等功能。\n3.求职者：求职者可在