片、音视频、应用软件等信息提供平台的服务。平台提供者可根据单位或个人用户需要向用户指定的终端、电子邮箱等递送、分发文本、图片、音视频、应用软件等信息。</p><p class=\"ql-align-justify\">例如：百度文库、新浪网、P2P视频等</p><p class=\"ql-align-justify\"><strong>②信息搜索查询服务</strong></p><p class=\"ql-align-justify\">是指通过互联网，采取信息收集与检索、数据组织与存储、分类索引、整理排序等方式，为用户提供网页信息、文本、图片、音视频等信息检索查询服务。</p><p class=\"ql-align-justify\">例如：搜狗搜索，百度搜索等</p><p class=\"ql-align-justify\"><strong>③信息社区平台服务</strong></p><p class=\"ql-align-justify\">是指在互联网上建立具有社会化特征的网络活动平台，可供注册或群聚用户同步或异步进行在线文本、图片、音视频交流的信息交互平台。</p><p class=\"ql-align-justify\">例如：豆瓣网、知乎网、微博等</p><p class=\"ql-align-justify\"><strong>④信息即时交互服务</strong></p><p class=\"ql-align-justify\">指利用互联网，并通过运行在计算机、智能终端等的客户端软件、浏览器等，为用户提供即时发送和接收消息（包括文本、图片、音视频）、文件等信息的服务。信息即时交互服务包括即时通信、交互式语音服务（IVR），以及基于互联网的端到端双向实时话音业务（含视频话音业务）。</p><p class=\"ql-align-justify\">例如：微信、陌陌等</p><p class=\"ql-align-justify\"><strong>⑤信息保护和处理服务</strong></p><p class=\"ql-align-justify\">指利用互联网，通过建设公共服务平台以及运行在计算机、智能终端等的客户端软件，面向用户提供终端病毒查询、删除，终端信息内容保护、加工处理以及垃圾信息拦截、免打扰等服务。</p><p class=\"ql-align-justify\">例如：百度手机卫士、垃圾信息拦截、腾讯手机管家等</p><p class=\"ql-align-justify\"><strong>（二）EDI从不同的业务种类可分为以下类别：</strong></p><p class=\"ql-align-justify\"><strong>1、交易处理业务</strong>（经营类电子商务）</p><p class=\"ql-align-justify\">是指办理各种银行业务、股票买卖、票务买卖、拍卖商品买卖、费用支付等。</p><p class=\"ql-align-justify\">例如：易趣、百度外卖、团购、滴滴出行、众筹、P2P商业贷款、家政服务APP等</p><p class=\"ql-align-justify\"><strong>2、网络/电子设备数据处理业务</strong></p><p class=\"ql-align-justify\">是指通过通信网络传送，对连接到通信网络的电子设备进行控制和数据处理的业务。</p><p class=\"ql-align-justify\">例如：阿里智能、京东智能、华为智能等/</p><p class=\"ql-align-justify\"><strong>3、电子数据交换业务</strong></p><p class=\"ql-align-justify\">是一种把贸易或其它行政事务有关的信息和数据按统一规定的格式形成结构化的事务处理数据，通过通信网络在有关用户的计算机之间进行交换和自动处理，完成贸易或其它行政事务的业务。</p><p class=\"ql-align-justify\">例如：海关报税EDI</p><p class=\"ql-align-justify\"><strong>其他</strong></p><p class=\"ql-align-justify\"><strong>①核心区别</strong></p><p class=\"ql-align-justify\">EDI和ICP的核心区别在于，EDI平台的性质是交易性的。ICP没有实现“交易”这个过程，二者相对而言是一“静”，一“动”。</p><p class=\"ql-align-justify\"><strong>②审核时间与人员</strong></p><p class=\"ql-align-justify\">ICP：内资，30-40工作日</p><p class=\"ql-align-justify\">EDI：内资，40-60工作日</p><p class=\"ql-align-justify\"><strong>③前置审批-【涉及到以上行业应先获得该行业经营许可后才能申请EDI、ICP】</strong></p><p class=\"ql-align-justify\">ICP:新闻 出版、教育、医疗保健、药品和医疗器械、文化 、视听节目 、BBS</p><p class=\"ql-align-justify\">EDI：互联网金融、网络约车</p><p class=\"ql-align-justify\"><strong>④两证合一</strong></p><p class=\"ql-align-justify\">两项业务可以同时申请，制证时是一张证书。</p><p class=\"ql-align-justify\"><strong>⑤特别注意：</strong></p><p class=\"ql-align-justify\">EDI:如果企业在网上销售自己的商品，是销售渠道的一种拓展，不属于经营电信业务，无需申请电信业务经营许可证，只需做好网站备案即可。</p><p class=\"ql-align-justify\">换句话说，通过互联网自产自销的平台不需要办理EDI许可证，如果有第三方商家入驻的电商平台就需要办理EDI许可证.</p><p class=\"ql-align-justify\"><strong>综上所述，ICP和EDI之间的区别从行业领域、审核要求、许可周期到平台性质、申办难度都有所区别</strong></p><p><br></p>','秦汉丝路（陕西）科技有限公司EDI、ICP代办,EDI、ICP代办','秦汉丝路（陕西）科技有限公司EDI、ICP代办,EDI、ICP代办','/uploads/20241110/5c2shvf3cb4.jpg','秦汉丝路（陕西）科技有限公司','',629,0,1731217473,1731217473,'hidden',67),(165,'多商户本地数字化经营系统','<p>程序基于CRMEB多商户，目前已经完整适配微信小程序和支付宝小程序；</p><p>在CRMEB的基础上二次二开发外卖、点餐、线下收银、代理商、积分商城、抽奖（定时开奖），分次核销、无痕广告、商户移动端等功能模块；</p><p>演示站正常运营半年，流水可观。</p><p>有兴趣的请联系</p>','秦汉丝路（陕西）科技有限公司多商户本地数字化经营系统,多商户本地数字化经营系统','秦汉丝路（陕西）科技有限公司多商户本地数字化经营系统,基于CRMEB多商户的一套本地数字化经营系统','/uploads/20241110/b12x052w3fd.jpg','秦汉丝路（陕西）科技有限公司','',795,0,1731217474,1731217474,'hidden',35),(166,'倍速私域建群机器人','<p>企业微信本次更新的还有诸多群管理的功能，加上之前的入群欢迎语、群监控、群活码等等功能，<strong style=\"color: rgb(255, 104, 39);\">可以说企业微信群接下来将会是社群运营的不二选择</strong>。</p><p><span style=\"color: rgb(255, 104, 39);\">如何快速裂变企业微信群，提高群内粉丝活跃度？</span>现在，<span style=\"color: rgb(255, 104, 39);\">倍速建群助手来啦</span>~这是一个强大的社群运营辅助工具。只需简单几步即可开展您的群营销活动。</p><p><br></p><p><strong style=\"color: rgb(33, 43, 136); font-size: 20px;\">亮点一</strong></p><p><strong style=\"color: rgb(33, 43, 136); font-size: 20px;\">“签到获取积分”</strong></p><p>入群粉丝，只需要回复【签到】即可获得积分，每天每人只能签到一次<img src=\"/uploads/20241110/lzzr4ryv1yc.jpg\"></p><p><br></p><p><strong style=\"color: rgb(33, 43, 136); font-size: 20px;\">亮点二</strong></p><p><strong style=\"color: rgb(33, 43, 136); font-size: 20px;\">“邀请好友入群赚积分”</strong></p><p>粉丝直接邀请好友入群即可赚积分，好友退群再重复邀请，多群重复邀请都无效，确保邀请更精准。<img src=\"/uploads/20241110/vmlwpgginb2.jpg\"></p><p><br></p><p><br></p><p><strong style=\"color: rgb(33, 43, 136); font-size: 20px;\">亮点三-商城模式</strong></p><p><strong style=\"color: rgb(33, 43, 136); font-size: 20px;\">“支持红包、实物、到店等多种玩法”</strong></p><p>粉丝获取积分后，点击兑换的时候直接进入商城进行兑换。商城支持【实物】【到店】【红包】等多种兑换形式，可以根据自己的业务需求进行设置。<img src=\"/uploads/20241110/5qfoounor43.jpg\"></p><p><br></p><p><br></p><p><strong style=\"color: rgb(33, 43, 136); font-size: 20px;\">亮点四-红包模式</strong></p><p><strong style=\"color: rgb(33, 43, 136); font-size: 20px;\">“积分兑换红包，实时到账”</strong></p><p class=\"ql-align-center\">粉丝获取积分后，点击奖励链接即可立即兑换，目前支持红包模式，实物模式；到店等近期也将逐步开放。<img src=\"/uploads/20241110/o5h4hxpn4ob.jpg\"></p><p class=\"ql-align-center\"><br></p><p><br></p><p><br></p><p><strong style=\"color: rgb(33, 43, 136); font-size: 20px;\">“如何领取群机器人？</strong></p><p>倍速建群助手创建群营销活动非常简单，现在只需简单3步即可开展群营销活动，目前仅支持企业微信群哦</p><p class=\"ql-align-center\"><strong style=\"color: rgb(255, 104, 39);\">步骤一：添加下方机器人为好友</strong><span style=\"color: rgb(136, 136, 136); font-size: 14px;\">&nbsp;</span><img src=\"/uploads/20241110/hll4wi5nrbs.jpg\"></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><br></p><p><strong style=\"color: rgb(255, 104, 39);\">步骤二：点击右上添加任意好友创建群聊。</strong></p><p>创建好群聊后，请务必修改群名称，<strong>并在群内发任意文字激活群聊</strong>。<img src=\"/uploads/20241110/fn5xbklp0wu.jpg\"></p><p><span style=\"color: rgb(51, 51, 51);\">创建好群聊后，机器人就会给您下发管理入口链接，点击链接即可管理您的群聊，设置群聊规则。</span></p><p><br></p><p><strong style=\"color: rgb(33, 43, 136); font-size: 20px;\">“已经有企业微信群，怎么用？”</strong></p><p>如果您已经有企业微信群，请根据以下步骤操作</p><p><strong style=\"color: rgb(255, 104, 39);\">步骤一：先将机器人设置为“星标好友”</strong><img src=\"/uploads/20241110/o1cxlsfnpga.jpg\"></p><p><br></p><p><strong style=\"color: rgb(255, 104, 39);\">步骤二：把机器人拉入需要管理的群聊</strong></p><p>由于旧群需要同步数据，所以入群时间会较慢，敬请等待。拉入群聊后，根据机器人下发的链接进入即可管理设置群规则</p>','乐山市青春校园网络科技有限公司倍速私域建群机器人,倍速私域建群机器人','乐山市青春校园网络科技有限公司倍速私域建群机器人,企业微信本次更新的还有诸多群管理的功能，加上之前的入群欢迎语、群监控、群活码等等功能，可以说企业微信群接下来将会是社群运营的不二选择。\n\n如何快速裂变企业微信群，提高群内粉丝活跃度？现在，倍速建群助手来啦~这是一个强大的社群运营辅助工具。只需简单几步即可开展您的群营销活动。','/uploads/20241110/gvhgeeolq14.jpg','乐山市青春校园网络科技有限公司','',85,0,1731217480,1731217480,'hidden',74),(167,'布伦国际美妆','<p>基于crmeb-java单商户1.3.5.1版本定制实现的专用于美妆行业的解决方案，整体页面看上去更加舒适大气美观，功能更加完善和强大，适用于任何化妆品或者美妆行业，可基于此进行定制化开发，以便使之更加契合客户本身的个性化需求！</p><p><img src=\"/uploads/20241110/c03vfx5pvfu.jpg\"><img src=\"/uploads/20241110/0czur2u5uld.jpg\"><img src=\"/uploads/20241110/2q2vgttarvp.jpg\"><img src=\"/uploads/20241110/ol1rzneoorw.jpg\"><img src=\"/uploads/20241110/zb4xbtr1ops.jpg\"><img src=\"/uploads/20241110/vapyq0kpn4z.jpg\"></p>','邂逅时尚（大连）科技有限公司布伦国际美妆,布伦国际美妆','邂逅时尚（大连）科技有限公司布伦国际美妆,基于crmeb-java单商户1.3.5.1版本定制实现的专用于美妆行业的解决方案，整体页面看上去更加舒适大气美观，功能更加完善和强大，适用于任何化妆品或者美妆行业，可基于此进行定制化开发，以便使之更加契合客户本身的个性化需求！','/uploads/20241110/qosmqcamnwa.jpg','邂逅时尚（大连）科技有限公司','',41,0,1731217483,1731217483,'hidden',62),(168,'CRMEB多商户精选插件合集包','<p>CRMEB特邀讲师，PHP开发经验10年+，擅长Vue，小程序，Flutter开发。</p><p>1、提供定制开发服务。</p><p>2、提供服务器搭建和配置。</p><p>3、提供APP上架服务 安卓和苹果。</p><p>​​​​​​​4、提供计算机软件专利证书申请。</p><p><br></p><p><br></p><p><br></p><p><br></p><p>2、课程简介&nbsp;&nbsp;&nbsp;&nbsp;</p><p>支持CRMEB多商户 课程插件还在更新中</p><p><br></p><p>具体如下</p><p>https://ke.qq.com/course/package/36555?tuin=6eec514</p><p><br></p><p><img src=\"/uploads/20241110/ybc5pmmybhj.jpg\"><img src=\"/uploads/20241110/2y5zzeehrq3.jpg\"></p><p><br></p>','嘉兴快充软件科技有限公司CRMEB多商户精选插件合集包,CRMEB多商户精选插件合集包','嘉兴快充软件科技有限公司CRMEB多商户精选插件合集包,多商户','/uploads/20241110/5kracokxvcq.jpg','嘉兴快充软件科技有限公司','',952,0,1731217484,1731217484,'hidden',91),(169,'Certum SSL/TLS 证书','<p>Certum 域名级证书是 Certum 旗下的入门级证书品牌，仅几分钟就可完成域名的验证和证书的颁发，域名验证证书只包含域名信息不包含其他组织信息，可以迅速保护您的网站、移动应用数据安全。Certum 证书可支持最多300个域名。</p><p><br></p><p>1.证书类型</p><p><br></p><p>来源正规代理渠道，非违规渠道，有效期内免费重签，到期可以走续费流程，浏览器兼容率99.9%！</p><p><br></p><p>支持通过Apple ATS认证，支持微信小程序，WebAPP，支持Nginx Apache IIS Tomcat等服务器环境</p><p><br></p><p>支持各种CDN及SLB：阿里云SLB/阿里云CDN/腾讯云CDN/又拍云CDN/七牛CDN/Ucloud CDN 等</p><p><br></p><p>这款是DV通配符证书，可以用在任意二级域名，保护 *.example.com 和 example.com</p><p><br></p><p>比如 www.example.com 和 api.example.com 和 mail.example.com等二级域名可以使用同一张证书，节约运维成本！</p><p><br></p><p>此证书完美支持IKE应用以及Web应用！兼容性好！</p><p><br></p><p>DV验证是目前签发速度最快的安全证书验证类型，OV企业验证和EV扩展验证的验证流程一般需要1-3工作日</p><p><br></p><p>2.时效</p><p>即时签发，验证完成后一般在5分钟内下发证书</p><p><br></p><p>3.购买流程</p><p>联系下单-发送域名/CSR-验证域名所有权-签发证书-完成</p><p><br></p><p>4.其他</p><p>CSR生成方法（默认由我们系统代为生成提交，如需自定义请联系说明）：</p><p>在线工具：https://certbase.com/tools/gen-csr</p><p><br></p><p>如果是通配符证书，域名记得要填 *.yourdomain.com，其他参照工具提示填写即可，最后记得勾上发送到邮箱</p><p><br></p><p>一定要妥善保存生成的key文件！DV证书公司信息无严格要求，OV/EV证书请如实填写</p><p>&nbsp;</p><p>验证域名所有权的方式：</p><p>正规GlobalSign产品均支持三种域名验证方式，均可快速验证</p><p><br></p><p>邮箱验证</p><p>DNS记录验证（TXT）</p><p>网站文件验证</p><p>如邮箱验证，请提前关闭域名的Whois隐私保护，确保whois信息中的域名管理员邮箱或 <a href=\"https://www.crmeb.com/cdn-cgi/l/email-protection\" class=\"__cf_email__\" data-cfemail=\"2647424b4f48665f49535442494b474f480845494b\">[email&#160;protected]</a>可以收到验证邮件</p><p><br></p><p>admin@不能使用的话可用替代前缀：administrator/postmaster/hostmaster/webmaster</p><p><br></p><p>客服发送验证邮件之后，点击验证邮件内链接，审批允许签发即可</p><p><br></p><p>也可以直接把邮件转发给我们的邮箱，我们代为验证</p><p><br></p><p>如果采用DNS/HTTP文件方式验证，客服会告知详细操作方法。</p><p><br></p><p><br></p><p>关于证书格式：</p><p>本店生成CSR的，证书默认提供PKCS#12 (PFX) 、JKS、Nginx、Apache等格式</p><p><br></p><p>可直接用于Nginx/Apache/IIS/Tomcat等Web服务器</p><p><br></p><p>其他应用（比如各种CDN/负载均衡SLB/路由器/NAS/防火墙），一般都是用PEM格式证书，但是有全链和非全链的区别，我们均会提供，有任何疑问请咨询客服。</p><p><br></p><p>自己提供CSR的，默认只提供 PEM 格式证书，可用于Nginx/Apache，如需IIS PFX格式，请自行在线转换或者提供私钥Key文件给客服。</p><p><br></p><p>关于证书部署：</p><p>证书包含安装服务（具体请咨询客服），如需部署调试服务，请联系客服咨询</p><p><br></p><p>附注：</p><p>如果有任何证书相关问题（兼容性问题/不出绿锁等），请与客服沟通排查问题出处，大部分的问题都是部署操作有误，请勿直接评分！</p><p><br></p><p>本店经营Comodo/Digicert/Symantec/GeoTrust/GlobalSign/Thawte/Entrust/RapidSSL/AlphaSSL/Certum等品牌全系列SSL证书，欢迎联系询价！</p><p><br></p>','成都汇智云安信息科技有限公司Certum SSL/TLS 证书,Certum SSL/TLS 证书','成都汇智云安信息科技有限公司Certum SSL/TLS 证书,Certum 域名级证书是 Certum 旗下的入门级证书品牌，仅几分钟就可完成域名的验证和证书的颁发，域名验证证书只包含域名信息不包含其他组