en',61),(296,'法大大电子合同','<p><span style=\"color: rgb(124, 124, 124); font-size: 16px;\">法大大是国内领先的电子签名与电子合同云平台，致力为企业、政府和个人提供基于合法数字签名技术的电子合同和电子单据的签署及管理服务。主要产品及服务包括：合同模板、合同编辑、智能审核、合同签署、存证、出证。法大大同时整合提供线上司法鉴定及律师服务，实现合同全生命周期的线上闭环。法大大产品严格依据《电子签名法》设计，获得ISO27001及ISO27018安全认证及保险公司承保，客户及合作伙伴包括：腾讯、微软（中国）、SAP、美团、携程、越秀地产、保利地产、红星美凯龙、徐工集团、中智、格力、中国电信、迪卡侬、海底捞、新东方、小红书等。</span></p><p><br></p><p><strong style=\"font-size: 24px; color: rgb(81, 90, 110);\">全新签约体验</strong></p><p><img src=\"/uploads/20241110/0qocnvcshlm.jpg\"></p><p>实名认证</p><p>实名认证可保障签约人身份的真实有效性，该功能支持个人用户及企业用户、合同发起方或者合同接收方在线完成 实名认证； 快速确认签约主体， 避免身份造假，萝卜章、假章的出现。个人认证： 支持手机端完成实名认证。认证方式支持腾讯云认证、支付宝认证。 企业认证： 支持法人/企业授权代理人身份认证； 企业法人：支持法人身份认证、对公打款认证、纸质材料认证。 企业授权代理人：支持法人授权认证、对公打款认证、纸质材料认证。</p><p><br></p><p>合同发起/签署</p><p>发起方发起合同，将发起的待签合同推送给设定的签署方签署，完成整个签约流程。 发起签署： 支持在电脑PC端，移动端（小程序/APP）发起合同签署。 接收签署： 支持短信、邮件、站内信推送签署合同；支持在PC端，移动端（小程序/APP/H5）完成合同签署。 发起签署形式： a.支持文件上传/模板发起,支持批量发送给多个签署方(上限100)。 b.支持上传多种文件格式。 c.可设置签约顺序，顺序签署或无序签署。 d.可添加抄送方，抄送方无序签署。 e.可指定签约方签署位置。</p><p><br></p><p>文件管理</p><p>控制台-文件管理： 帮助管理者收录合同，区分合同状态，提供合同查阅、下载、打印等功能。</p><p>工作台-文件： 帮助企业/个人收录所属合同；区分合同状态，提供合同查阅、催办、下载、打印等功能。</p><p><br></p><p>模板管理</p><p>控制台-模板管理： 1.管理者可新增、编辑模板；模板支持归类、查询、下载、删除、等操作； 2.新增模板：添加签约对象（个人、企业或批量添加），设置模板控件。</p><p>工作台-模板： 企业员工可查看公司已有模板，并选择使用模板发起签约。</p><p>优点： √ 可重复使用，无需多次上传 √ 可批量发起签署并批量填写合同内容 √ 签约方可灵活配置</p><p><br></p><p>印章管理</p><p>控制台-印章管理： 帮助企业管理公司印章；支持一键生成各业务类型专属印章、上传印章和绑定Ukey印章；可对印章进行持有人分配及删除； 工作台-印章： 企业员工/个人，可在个人中心查看持有印章，印章可在签署合同时使用。</p><p><br></p><p>组织架构管理</p><p>控制台-组织管理： 帮助管理者管理公司各个职能部门及员工合同签署及配置相应的角色权限。 支持增删查改【部门】； 支持创建的部门新增员工（可批量导入）、配置对应角色权限； 支持增删查改【角色】，配置各个角色可查看和使用的功能； 工作台-申请加入企业： 支持员工主动申请加入企业；由企业管理员审批通过后，可加入该企业组织。行使响应的角色权力。</p><p><br></p><p>审批管理</p><p>控制台-审批管理： 帮助管理者创建、管理各业务类型合同审批流程；为各流程设置节点及对应审批人。 工作台-审批： 企业员工，可在工作台-审批模块查看流转到自己的合同并进行审批。</p>','成都汇智云安信息科技有限公司法大大电子合同,法大大电子合同','成都汇智云安信息科技有限公司法大大电子合同,法大大是国内领先的电子签名与电子合同云平台，致力为企业、政府和个人提供基于合法数字签名技术的电子合同和电子单据的签署及管理服务。主要产品及服务包括：合同模板、合同编辑、智能审核、合同签署、存证、出证。法大大同时整合提供线上司法鉴定及律师服务，实现合同全生命周期的线上闭环。法大大产品严格依据《电子签名法》设计，获得ISO27001及ISO27018安全认证及保险公司承保，客户及合作伙伴包括：腾讯、微软（中国）、SAP、美团、携程、越秀地产、保利地产、红星美凯龙、徐工集团、中智、格力、中国电信、迪卡侬、海底捞、','/uploads/20241110/gbncagk2tga.jpg','成都汇智云安信息科技有限公司','',419,0,1731217868,1731217868,'hidden',27),(297,'<span>官方推荐</span>陪诊陪护系统源码，包含陪护人员端，便捷的预约管理。产品级开发，开发者文档齐全，便于二开','<p><img src=\"/uploads/20241110/emqq1zyosqb.jpg\"></p>','广东有象信息技术有限公司陪诊陪护系统源码，包含陪护人员端，便捷的预约管理。产品级开发，开发者文档齐全，便于二开,陪诊陪护系统源码，包含陪护人员端，便捷的预约管理。产品级开发，开发者文档齐全，便于二开','广东有象信息技术有限公司陪诊陪护系统源码，包含陪护人员端，便捷的预约管理。产品级开发，开发者文档齐全，便于二开,码小象陪诊陪护系统源码，包含陪护人员端，便捷的预约管理。产品级开发，开发者文档齐全，便于二开。','/uploads/20241110/nru4tlenelt.jpg','广东有象信息技术有限公司','',588,0,1731217871,1731217871,'hidden',55),(298,'论坛小程序','<p><img src=\"/uploads/20241110/efh4n4zokkk.jpg\"></p>','深圳市环企云科技有限公司论坛小程序,论坛小程序','深圳市环企云科技有限公司论坛小程序,简洁大方的论坛小程序','/uploads/20241110/nkt0jendjwf.jpg','深圳市环企云科技有限公司','4500',686,0,1731217875,1731217875,'hidden',94),(299,'「家政协会」','<p><img src=\"/uploads/20241110/bafkxs3ngnq.jpg\"><img src=\"/uploads/20241110/c14hyisuhnu.jpg\"></p>','安徽远之航云计算有限公司「家政协会」,「家政协会」','安徽远之航云计算有限公司「家政协会」,提供放心家政数字平台搭建解决方案！','/uploads/20241110/xzibxvhnnan.jpg','安徽远之航云计算有限公司','',666,0,1731217877,1731217877,'hidden',3),(300,'新联会','<p><img src=\"/uploads/20241110/ax25kjysfz5.jpg\"></p>','安徽远之航云计算有限公司新联会,新联会','安徽远之航云计算有限公司新联会,新的社会阶层联谊会','/uploads/20241110/wcwk2apmpcs.jpg','安徽远之航云计算有限公司','',271,0,1731217878,1731217878,'hidden',36),(301,'「行业协会」','<p><img src=\"/uploads/20241110/gl0oha1olxm.jpg\"><img src=\"/uploads/20241110/s2p4ezohpne.jpg\"></p>','安徽远之航云计算有限公司「行业协会」,「行业协会」','安徽远之航云计算有限公司「行业协会」,提供各行业协会解决方案','/uploads/20241110/w2luztpprh0.jpg','安徽远之航云计算有限公司','',360,0,1731217881,1731217881,'hidden',70),(302,'IPv6改造','<p><span style=\"font-size: 16px; color: rgb(39, 174, 96);\">随着国家推进 IPv6 规模部署行动计划的贯彻落实，以及工业互联网、物联网、5G 等前沿技术的快速发展，各行业用户 IPv6 改造诉求愈发强烈，短时间内IPv6无法完全替代IPv4，此 IPv6 解决方案可满足个人、互联网、金融、企业集团、政府、传媒等各行业客户的云上、云下多场景 IPv6 改造需求,对原有IPv4网站和应用无任何改动，具有很好的灵活性、便捷性、稳定性、安全性，提供丰富的产品选择和可靠安全的服务体验。快速实现让现有IPv4业务系统具备IPv6终端访问能力。</span></p><p><span style=\"font-size: 18px; color: rgb(231, 76, 60);\">---------IPv6转换服务技术原理----------------</span><span style=\"font-size: 14px; color: rgb(51, 51, 51);\">&nbsp;</span><img src=\"/uploads/20241110/yydr53unto5.jpg\"></p><p><span style=\"font-size: 18px; color: rgb(231, 76, 60);\">---------IPv6转换服务的主要优势----------------</span></p><p><br></p><p><span style=\"color: rgb(39, 174, 96); font-size: 16px;\">1、经济高效</span></p><p><span style=\"font-size: 16px; color: rgb(24, 24, 24);\">无需改造现有基础架构，映射规则生效快，可有效节省时间和开发成本。</span></p><p><span style=\"font-size: 16px; color: rgb(39, 174, 96);\">2、广泛适用</span></p><p><span style=\"font-size: 16px; color: rgb(24, 24, 24);\">只要现有业务具有IPv4公网地址，都可以使用我司IPv6转换服务，支持非我司IP。</span></p><p><span style=\"font-size: 16px; color: rgb(39, 174, 96);\">3、灵活易用</span></p><p><span style=\"font-size: 16px; color: rgb(24, 24, 24);\">便捷配置映射规则，等待生效后即可实现地址转换，按需购买，弹性升级带宽。</span></p><p><span style=\"font-size: 16px; color: rgb(39, 174, 96);\">4、支持多协议</span></p><p><span style=\"font-size: 16px; color: rgb(24, 24, 24);\">IPv6转换服务当前提供四层模式，支持TCP、UDP协议。</span></p><p><br></p><p><span style=\"font-size: 20px; color: rgb(231, 76, 60);\">版本介绍:</span></p><p>&nbsp;</p><p><span style=\"font-size: 16px;\">IPv6升级改造转换服务分为 基础版 和 政务版：</span></p><p><span style=\"color: rgb(231, 76, 60); font-size: 16px;\">基础版：</span><span style=\"font-size: 16px;\">&nbsp;适用于常规网站，改造后能够支持通过 IPv6 协议访问。</span></p><p><span style=\"color: rgb(22, 160, 133); font-size: 16px;\">政务版：</span><span style=\"font-size: 16px;\">针对政务网站IPv6改造，能彻底解决外链引起的天窗问题，改造后可满足《政府网站IPv6改造核验标准》；如要支持https外链，还需提供一个*.domain.com的泛证书 ，以免https内外链不可达。</span></p><p><br></p>','安徽远之航云计算有限公司IPv6改造,IPv6改造','安徽远之航云计算有限公司IPv6改造,IPv6改造','/uploads/20241110/r3wj3q5cbwv.jpg','安徽远之航云计算有限公司','',987,0,1731217882,1731217882,'hidden',41),(303,'CRMEB标准版连连大额支付','<p>CRMEB标准版4.7对接了连连支付、支持钱包、网关、收银台、网银、快捷等支付。大额收单必备</p><p><img src=\"/uploads/20241110/1rfjmyz45ln.jpg\"></p>','成都优世科技有限公司CRMEB标准版连连大额支付,CRMEB标准版连连大额支付','成都优世科技有限公司CRMEB标准版连连大额支付,标准版对接连连支付。','/uploads/20241110/cd2t2tvmxg0.jpg','成都优世科技有限公司','',853,0,173