CREATE TABLE `fa_soft` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL COMMENT '发布人',
  `category_id` int(11) NOT NULL COMMENT '应用分类',
  `name` varchar(60) CHARACTER SET utf8 NOT NULL COMMENT '应用名称',
  `mark` char(60) NOT NULL COMMENT '应用标识',
  `description` varchar(300) CHARACTER SET utf8 NOT NULL COMMENT '应用描述',
  `keyword` varchar(120) CHARACTER SET utf8 NOT NULL COMMENT '关键字',
  `env` varchar(300) NOT NULL COMMENT '安装环境',
  `image` varchar(100) CHARACTER SET utf8 NOT NULL COMMENT '缩略图',
  `logo_image` varchar(120) CHARACTER SET utf8 NOT NULL COMMENT 'logo',
  `bg_image` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '背景图',
  `file` varchar(100) CHARACTER SET utf8 NOT NULL COMMENT '源码文件',
  `encrypt` enum('0','1') NOT NULL DEFAULT '0' COMMENT '源码加密:0=否,1=是',
  `demojson` varchar(1000) CHARACTER SET utf8 NOT NULL COMMENT '演示地址:name=名称,url=地址,image=二维码',
  `featurejson` varchar(3000) CHARACTER SET utf8 NOT NULL COMMENT '功能特性:title=标题,desc=描述',
  `previewjson` varchar(1000) CHARACTER SET utf8 NOT NULL COMMENT '运行截图:name=名称,images=截图相册',
  `versionjson` varchar(3000) CHARACTER SET utf8 NOT NULL COMMENT '版本升级:time=更新时间,version=更新版本,content=更新内容',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '价格（免费为0）',
  `download` int(11) NOT NULL DEFAULT '0' COMMENT '下载次数',
  `pv` int(11) NOT NULL DEFAULT '0' COMMENT '浏览量',
  `createtime` int(11) NOT NULL COMMENT '创建时间',
  `updatetime` int(11) NOT NULL COMMENT '更新时间',
  `status` enum('hidden','normal') CHARACTER SET utf8 NOT NULL DEFAULT 'hidden' COMMENT '状态:hidden=隐藏,normal=显示',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8mb4 COMMENT='应用表';
