INSERT INTO `fa_soft` VALUES (8,1,9,'CRMEB标准版 新零售社交电商系统','CRMEB','追踪新零售模式新趋势，打造集直播、分销、拼团、砍价、抽奖等热门社交电商玩法；打通多端用户数据，构建全场景新零售社交电商解决方案，赋能开发者，提速企业数字化；倾力打造全开源超高性价比社交电商系统','CRMEB，新零售社交电商系统','服务环境：linux/windows\r\nweb服务：Nginx/Apache/iis\r\nPHP版本：7.1～7.4\r\n数据库：Mysql 5.7~8.0\r\nRedis：Redis 6.0以上','/uploads/20241109/b8e1849f3f380e067a288269458a3143.jpg','/uploads/20241109/3d9f4253486aeaef94a2b8008a6aad05.png','/uploads/20241109/3c95ae53b3e77be29b1a7c4f5a77f504.jpg','/uploads/20241109/b40f2ec8769ebee23a395fa2b907e4b4.zip','0','[{\"name\":\"h5\",\"url\":\"https://xidicom.cn\",\"image\":\"/uploads/20241109/ead68643c6df45a42e2add1a89335ff8.png\"},{\"name\":\"小程序\",\"url\":\"http://xidicom.cn\",\"image\":\"/uploads/20241109/e6836e93e1de94682a18f4844f4e2fd7.png\"},{\"name\":\"管理后台（账号demo，密码crmeb.com）\",\"url\":\"http://v5.crmeb.net/admin\",\"image\":\"\"}]','[{\"title\":\"多终端覆盖\",\"desc\":\"PC端 小程序 APP H5 PC端管理后台 移动端订单处理\"},{\"title\":\"店铺管理\",\"desc\":\"店铺diy装修 线下多点核销 会员系统 客服系统 数据统计 物流查询 发票管理 电子面单\"},{\"title\":\"营销拓客\",\"desc\":\"直播带货 多人拼团 砍价助力 限时秒杀 优惠券 满额包邮\"},{\"title\":\"会员/分销\",\"desc\":\"付费会员 等级会员 会员折扣 会员积分 事业部代理分销 人人分销 指定分销 满额分销\"},{\"title\":\"分销拓客\",\"desc\":\" 多种分销模式、多种返佣规则，促进分销列表推广\"},{\"title\":\"营销转化\",\"desc\":\" 具备拼团、砍价、秒杀、抽奖、优惠券等多种营销工具，促进资源转化\"},{\"title\":\"会员管理\",\"desc\":\" 用户等级管理+SVIP付费会员制度，充分挖掘会员价值\"},{\"title\":\"DIY装修\",\"desc\":\" 商城首页DIY自定义装修，个性化设计、更加灵活多变\"},{\"title\":\"直播带货\",\"desc\":\" 紧跟新零售电商风口，小程序直播带货，所见即所得，实现红利变现\"},{\"title\":\"客服系统 \",\"desc\":\"系统内置智能客服系统，同时支持多种客服系统对接，沟通更顺畅\"},{\"title\":\"消息通知\",\"desc\":\" 对接阿里云和腾讯云短信，具备全面周到的消息提醒服务\"},{\"title\":\"运费模板\",\"desc\":\" 多元化的运费计算方式，可进行满额包邮、续件运费优惠等自定义设置\"},{\"title\":\"用户管理\",\"desc\":\" 用分组、标签进行用户分类管理，提取用户画像信息，分类营销更精准\"},{\"title\":\"积分商城\",\"desc\":\" 利用积分调动现有用户积极性，提高用户活跃度，增加用户粘性\"}]','[{\"name\":\"前台界面\",\"images\":\"/uploads/20241109/735eff9957900f2beb9b16bf92fec6e0.png,/uploads/20241109/c849105cf95ac402ceebcedae2725998.png,/uploads/20241109/34d0dc4470797b946a065059a03fc410.png,/uploads/20241109/a2fc56a1fe80ed1aaa17d6277c8cc73a.png,/uploads/20241109/b41b40ef6336eee79ea8f613e266b49e.png,/uploads/20241109/5d22b69395ae6b694a5261f8ec7900c1.png,/uploads/20241109/c2132d9c4c7f4cc1ab1cc0c4dba2a050.png,/uploads/20241109/2e31f62eb2eba5a816b9cc902c7559b5.png,/uploads/20241109/4566607e05e8fefd09e56542a1519f62.png\"},{\"name\":\"后台\",\"images\":\"/uploads/20241109/a3789b5a03a690157363ddfdc462d8c2.png,/uploads/20241109/90aa022c9a3cbdb451123681a75b9ccd.png,/uploads/20241109/c5c312be54923119876f1cf3e79b4718.png\"}]','[{\"time\":\"2024-11-09\",\"version\":\"1.1.0\",\"content\":\"第一版新版本\"}]',1799.00,0,14,1731127619,1731138532,'hidden'),(9,1,19,'DBShop 商城系统','DBShop','DBShop企业级开源商城系统，使用PHP语言基于Laminas + Doctrine 2 组合框架开发完成。可定制、多终端、多场景、多支付、多货币；严谨的安全机制，可靠稳定；方便的操作管理，节约时间；清晰的权限分配，责任分明；便捷的更新处理，一键搞定；丰富的插件市场，扩展无限','DBShop 商城系统','服务器系统 Linux、Unix、Mac、Windows、其他\r\n\r\nweb服务器 Apache、Nginx、IIS、其他\r\n\r\nMySQL版本 >= 5.6\r\n\r\nPHP版本 7.4及以上版本\r\n\r\nPHP扩展|库\r\n\r\nPDO\r\nSSL（openssl）\r\nFileinfo\r\nintl\r\nCurl\r\nGD2\r\n系统空间 >= 500M','/uploads/20241109/136022535b0955f8f9b23f4075d16871.png','/uploads/20241109/fa5e9a9575f8c4547ed28e2604ffd708.png','','/uploads/20241109/fa522f4b5904dde9129edbc9ed77e61f.zip','0','[{\"name\":\"小程序\",\"url\":\"https://xidicom.cn\",\"image\":\"/uploads/20241109/69a1f97a6b5a57dac84ebbd057a359c0.jpg\"},{\"name\":\"前台演示\",\"url\":\"https://v3.dbshop.net\",\"image\":\"\"},{\"name\":\"后台演示\",\"url\":\"https://v3.dbshop.net/admin\",\"image\":\"\"}]','[{\"title\":\"多价格\",\"desc\":\" 可设置多级别商品价格，同商品可根据会员组不同显示不同价格。\"},{\"title\":\"多货币\",\"desc\":\" 设置全球不同地区货币，前台可方便切换不同货币价格显示，满足多元化支付需求。\"},{\"title\":\"对接ERP \",\"desc\":\"方便的与DBErp、cloudERP (官方开发的进销存系统)进行对接，统一系统订单销售管理。\"},{\"title\":\"一键更新 \",\"desc\":\"无需繁琐的操作，系统更新、bug修复，第一时间云提醒，只需要轻点鼠标，即可完成。\"}]','[{\"name\":\"前端\",\"images\":\"/uploads/20241109/a9f80af3a29d121310d432a33eeee2ed.png\"}]','[{\"time\":\"2024-11-09\",\"version\":\"1.1.0\",\"content\":\"第一版发布\"}]',1699.00,0,4,1731130822,1731138544,'hidden'),(10,1,19,'DSMall（多店