INSERT INTO `fa_update` VALUES (1,'V1.0.0','<p>第一个版本上线！今天也是作者的生日！666</p><p>期待下一版本···持续优化</p><p><br></p>',1732118400,1732540480,'normal'),(2,'v1.0.1','<p>升级第二版</p>',1732535930,1732540492,'normal'),(3,'v1.0.2','<p>升级第三版本</p>',1732535959,1732535959,'normal'),(4,'v1.0.3','<p>1，自己发送的消息，没有更新会话列表（已修改，11-23）</p><p>2，客户端消息持久化，服务器只提供转发功能</p><p>对方离线时，只能发送一条消息，并后台记录更新会话，</p><p>3，心跳检测，保活（客户端还是服务器？）（服务器端，11-23）</p><p>4，输入状态检测，并动态更新标题（已完成，11-23）</p><p>5，在线状态实时检测更新方案</p><p>6，消息已读状态实时更新方案</p><p>7，前后端字段统一：from_id，to_id（已修改，11-22）</p><p>8，前端聊天界面优化（部分优化，11-23）</p><p>9，第一次发消息时对方会收到2条，消息列表里</p><p>10，标题动态改变全局显示了</p><p>11，消息列表头像不显示</p>',1732536127,1732536127,'normal');
/*!40000 ALTER TABLE `fa_update` ENABLE KEYS */;
UNLOCK TABLES;

